INSERT INTO `articles` VALUES (60,'지역','딸기 무료나눔 합니다',NULL,'<p>이번에 딸기를 수확했는데 너무너무 맛있어서 광주 사시는 분들께 무료나눔 하려고 합니다~~</p><p>댓글이나 팜톡 주세요!!!!😎😁</p>','2022-11-17 09:33:09',NULL,8,NULL,1),(61,'지역','같이 재료 사러 가실 분 !!!!!',NULL,'<p>이번에 처음 토마토 키워보려고 하는데 아는게 많이 없어서 ㅠㅠㅠ 도와주실 농사 선배 구해봅니다아....</p>','2022-11-17 09:36:07',NULL,8,NULL,2),(62,'정보','방울토마토 두배로 맛있게 먹는 방법','https://firebasestorage.googleapis.com/v0/b/handfarm-f3155.appspot.com/o/images%2Ftest%2F%EB%B0%A9%ED%86%A0.jfif?alt=media&token=42759b1c-f18f-4ae9-ac50-951ef6c2200b','<p><img src=\"data:image/jpeg;base64,\"></p><p>믹서기에 꿀 왕창 넣고 갈아 먹으면</p><p>토마토쥬스 완성</p>','2022-11-17 09:42:32',NULL,8,2,NULL),(63,'정보','딸기 키우는 꿀팁','https://firebasestorage.googleapis.com/v0/b/handfarm-f3155.appspot.com/o/images%2Ftest%2F%EC%99%95%EB%94%B9%E3%85%87%EA%B8%B0.jpg?alt=media&token=10c9fcf6-5794-4621-a6d2-db461d91b891','<p>사랑과 정성만 있다면</p><p>당신도 왕딸기를 키울 수 있습니당</p>','2022-11-17 09:50:46',NULL,11,1,NULL),(64,'정보','우리집.방울토마토.예쁘죠?','https://firebasestorage.googleapis.com/v0/b/handfarm-f3155.appspot.com/o/images%2Ftest%2Fq%ED%84%B0%EB%A7%88%ED%86%A0.jpg?alt=media&token=36ccb291-f204-4647-bcd2-06c4fd031bce','<p>핸드팜 덕분에 방울토마토 쉽게 집에서 키워보네요.^^~</p><p>여러분들도 핸드팜 써보셔요~~~</p>','2022-11-17 09:53:05','2022-11-17 00:53:24',11,2,NULL),(65,'지역','우리집.방울토마토.예쁘죠?',NULL,'<p>핸드팜 덕분에 방울토마토 쉽게 집에서 키워보네요.^^~</p><p>여러분들도 핸드팜 써보셔요~~~</p>','2022-11-17 09:53:23',NULL,11,NULL,NULL),(66,'정보','새벽의 이슬을 맞으며,,^^~','https://firebasestorage.googleapis.com/v0/b/handfarm-f3155.appspot.com/o/images%2Ftest%2F%EC%99%95%EB%94%B8%EA%B8%B0.jpeg?alt=media&token=e87e18c3-feb5-4950-a120-807aa6ea1314','<p>출석 인증합니다</p><p>딸기 향기가 사람을 행복하게 하네요^^~~</p><p>핸드팜 회원 여러분 오늘 하루도 화이팅~~!!!!!!!!</p>','2022-11-17 09:54:35',NULL,11,1,NULL),(67,'지역','2022.11.17 시세 변동 뉴스',NULL,'<p>도매) 광주</p><p>전남 해남, 전북 고창, 광주 등지에서 출하됨</p><p>정부 수매정책으로 인한 여파로 출하량 조절 등 오름세에 거래됨</p><p>소매가격 20kg 기준 상품 50,000원 선에 거래됨</p><p>산지 재고량 감소로 현재 가격 상승 중이고 앞으로도 강보합세 전망</p><p><br></p><p>출처 : 한국 농수산식품유통공사</p>','2022-11-17 09:56:17',NULL,11,NULL,1),(68,'지역','2022-11-17 시세변동 뉴스',NULL,'<p><span style=\"background-color: rgba(221, 223, 228, 0.04); color: rgb(221, 223, 228);\">도매)서울</span></p><p><span style=\"background-color: rgba(221, 223, 228, 0.04); color: rgb(221, 223, 228);\">경북 안동, 전북 정읍, 충북 제천·충주 등지에서 반입됨</span></p><p><span style=\"background-color: rgba(221, 223, 228, 0.04); color: rgb(221, 223, 228);\">햇초가 반입되고 고가에 거래되었으나 소비부진이 지속되면서 소폭 내림세로 거래됨</span></p><p><span style=\"background-color: rgba(221, 223, 228, 0.04); color: rgb(221, 223, 228);\">도매가격은 30kg 기준 50,000원 내린 상품 675,000원, 중품 625,000원 선에 거래됨</span></p><p><span style=\"background-color: rgba(221, 223, 228, 0.04); color: rgb(221, 223, 228);\">전년 대비 반입 상품성이 낮아 상품 물량 부족으로 품위에 따른 가격차가 벌어질 가능성이 있으며 당분간 현재 가격이 유지될 전망</span></p>','2022-11-17 09:57:07',NULL,11,NULL,2);
